webpackJsonp([0xf224509ed082],{1333:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/rituals-dogma-and-the-agile-manifesto/index.md absPath of file >>> MarkdownRemark",html:'<p>I can’t quite work out if Agile is a buzzword, a cult or some larger form of organised religion. I’m lost in a sea of ritualistic meetings and awash with stuff like #shipit and “Get Shit Done”.</p>\n<p>Build, Measure, Learn. Done is better than Perfect. Stop, Start, Continue. Be Lean. Deliver, Iterate, Repeat. Liked, Lacked, Loved, Longed for. Sad, Mad, Glad, Puzzled. Retro, Backlog, Burndown, Velocity. <em>Landing the Plane.</em> </p>\n<p><img src="/content/images/2017/01/cult-of-agile.png" alt="Are you sure this isn&#x27;t a cult?"></p>\n<p>Are we even doing the right thing? Do we know what we’re doing and – more importantly – why we’re doing it? I’m so confused.</p>',frontmatter:{title:"Rituals, dogma and the Agile Manifesto.",date:"January 04, 2017",tags:["agile"],url:null}}},pathContext:{}}}});
